    @Ignore
    @Test
    public void timeToByte() {
        //设定可预订时间为8点到12点
        Date time1 = Func.getTime(2019, 5, 3, 12, 00, 00);
        Date time2 = Func.getTime(2019, 5, 3, 13, 30, 00);
        System.out.println(time1);
        Calendar calendar = Calendar.getInstance();
        Calendar calendar1 = Calendar.getInstance();
        calendar.setTime(time1);
        calendar1.setTime(time2);
        int startHour = calendar.get(Calendar.HOUR_OF_DAY) - 8 - 7;
        int endHour = calendar1.get(Calendar.HOUR_OF_DAY) - 8 - 7;
        assertEquals(startHour, 4);
        assertEquals(endHour, 5);
    }

