    @Test
    public void Base64ToImageTest() {
        // 对字节数组字符串进行Base64解码并生成图片
        BASE64Decoder decoder = new BASE64Decoder();
        try {
            // Base64解码

            String basePath = "./src/main/resources/static/";
            String imgFile = "activity_image/" + Func.createImageName() + ".jpg";
            String imgFilePath = basePath + imgFile;//新生成的图片

            String imgStr = "data:image/jpeg;base64,";
            String imageDataBytes = imgStr.substring(imgStr.indexOf(",") + 1);//attention！逗号前的字符不用decode,哭晕在厕所
            //InputStream stream = new ByteArrayInputStream(Base64.decode(imageDataBytes.getBytes(), Base64.DEFAULT));
            byte[] b = decoder.decodeBuffer(imageDataBytes);
            for (int i = 0; i < b.length; ++i) {
                if (b[i] < 0) {// 调整异常数据
                    b[i] += 256;
                }
            }
            // 生成jpeg图片
            //String imgFilePath = "D:\\tanbing2.jpg";// 新生成的图片
            OutputStream out = new FileOutputStream(imgFilePath);
            out.write(b);
            out.flush();
            out.close();
        } catch (Exception e) {
        }
    }

    @Test
    public void testThumbnail() {
        BASE64Decoder decoder = new BASE64Decoder();
        try {
            // Base64解码
            String basePath = "./src/main/resources/static/";
            String imgFile = "activity_image/" + Func.createImageName() + ".jpg";
            String thumbnailFile = "activity_thumbnail/" + Func.createImageName() + ".jpg";
            String imgFilePath = basePath + imgFile;//新生成的图片
            String thumbFilePath = basePath + thumbnailFile;
            String imgStr = "data:image/jpeg;base64,";
//            String imgStr = "data:image/jpeg;base64,";
            String imageDataBytes = imgStr.substring(imgStr.indexOf(",") + 1);//attention！逗号前的字符不用decode,哭晕在厕所
            //InputStream stream = new ByteArrayInputStream(Base64.decode(imageDataBytes.getBytes(), Base64.DEFAULT));
            byte[] b = decoder.decodeBuffer(imageDataBytes);
            for (int i = 0; i < b.length; ++i) {
                if (b[i] < 0) {// 调整异常数据
                    b[i] += 256;
                }
            }

            // 生成jpeg图片
            //String imgFilePath = "D:\\tanbing2.jpg";// 新生成的图片
            OutputStream out = new FileOutputStream(imgFilePath);
            out.write(b);
            out.flush();
            out.close();
            Thumbnails.of(imgFilePath).size(1000, 500).toFile(thumbFilePath);
        } catch (Exception e) {
        }
    }

